import React from "react";
import PropTypes from "prop-types";
import Grade from './AllGradeList.model.css'

const AllGradeList = ({ title, schoolYear, grades }) => {
  return (
    <div>
      <div>{title}</div>
      <div>
          {
              grades.map(grade=>(
                  <div>
                      <div className={Grade.grades_title}>
                          {grade}. клас
                      </div>
                      <table>
                          <tbody>
                          {schoolYear.map(subGrade => (
                              <React.Fragment>
                                  {subGrade.grade === grade ? (
                                      <tr className="search_row">
                                          <td>
                                              {subGrade.grade}
                                              {subGrade.subGrade}
                                          </td>
                                          <td>{subGrade.teacher}</td>
                                          <td>
                                              <button className="stu_add">redakciika :)</button>
                                          </td>
                                      </tr>
                                  ) : (
                                      ""
                                  )}
                              </React.Fragment>
                          ))}
                          </tbody>
                      </table>
                  </div>
              ))

          }

      </div>
    </div>
  );
};

AllGradeList.propTypes = {};

export default AllGradeList;
